import React from "react";
import Image from "./image";

class UserProfile extends React.Component {
 render () {
   const {name, email, avatar} = this.props.user

    return (
      <div>
        <p>{name}</p>
        <p>{email}</p>
        <Image source={avatar} alternativeText='Avatar'/>
      </div>
    ) ;
 }
}

export default UserProfile
